import * as actionTypes from './actionTypes';


export const onShowInfo = () =>{
    return {
        type: actionTypes.SHOW_INFO_BASKET
    }
} 

export const onRemoveFromBasket = (modelo, precio) =>{
    return{
        type: actionTypes.REMOVE_FROM_BASKET,
        modelo: modelo,
        precio: precio,
      }
}
